import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import HeaderStyles from '../styles/Header.scss';

  const Header = (props) => {

    return (
      <div className='navbar-container'>
        <nav className='navbar'>
          <NavLink className='btn from-top' to="/">Home</NavLink> 
          <NavLink className='btn from-top' to="https://github.com/taylorbcool">GitHub</NavLink>
          <NavLink className='btn from-top' to="/about">About</NavLink>
          <NavLink className='btn from-top' to="/work">Work</NavLink>
          <NavLink className='btn from-top' to="/contact">Contact</NavLink>
        </nav>
      </div>
    );
  }

  export default Header;
